// import axios from "axios";
const axios = require
export const createAuthConfig = (apiUrl, data) => {
  return {
    url: apiUrl,
    method: "POST",
    headers: {
      "Content-Type": "application/json",
    },
    data,
  };
};

export const apiRequest = async (data) => {
  const apiUrl =
    "https://mobile-services-92086589662.us-central1.run.app/CountryCodes"; // Fixed Syntax Error
  const config = createAuthConfig(apiUrl, data);

  try {
    const response = await axios(config);
    return response.data;
  } catch (error) {
    console.error("API Request Failed:", error);
    throw error;
  }
};
